import timeit

def fib(n):
    a,b=0,1
    while a<n:
        print(a,end='')
        a,b=b,a+b
        print()
start=timeit.default_timer()
fib()
stop=timeit.default_timer()
print()
print("Start:",start," Stop:",stop," Total Time:",stop-start)


